import React from 'react';
import { Switch, Route } from 'react-router-dom';

import { AuthProvider } from './contexts/AuthContext';

import Social from './pages/Main/Social';


import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <AuthProvider>

      <Switch>
        <Route path="/" component={Social} />
      </Switch>

    </AuthProvider>
  );
};

export default App;
